import React from 'react';
import { Link } from 'react-router-dom';
import PageNotFound from "./page-not-found-style"

const NotFound = () => (
    <PageNotFound>
        <h1>404 - Not Found!</h1>
        <Link to="/">
            Go Home
        </Link>
    </PageNotFound>
);

export default NotFound;
